import React, { useState } from 'react'
import styles from './List.module.css'

const SearchInput = (props) => {
    const [value,setValue] = useState('')
    const addNewPurpose = () => {
        props.addNewPurpose(value)
    }
    return(
        <>
        <input type="text" onSubmit={() => addNewPurpose()} placeholder="Ceate new part of your list" value={value} onChange={(e) => setValue(e.currentTarget.value)} className={styles.searchInput}/>
        <input type="submit" />
        </>
    )
}

export default SearchInput
